function setup_popover_clicks(){$(document).click(function(a){$(a.target).hasClass("no-click-event")||$(".popover").each(function(a,b){if(!$(b).is(":hidden")){var c=$(b).find("#share_id").attr("value"),d=$(b).find("#share_id").attr("name"),e=$("#id_checkbox_"+c);$.get("/shares/"+d+"/accepts_uploads",function(a){a=="False"?e.attr("checked",!1):e.attr("checked","checked"),e.change()})}})})}function setup_action_buttons(){$(".action_button").each(function(){$(this).click(function(){thelink=$(this).parent().attr("action"),$.get(thelink,function(a){})})})}$(document).ready(function(){setup_action_buttons(),setup_ajaxized_links(".ajax-shares-link"),setup_popover_clicks()});